import React,{Component} from "react";
class Home extends Component {
  constructor(props) {
    super(props);
    this.state = {
      bookIssues: [],
      error: ""
    };
  }
  render() {
    return (
      <div>
        <h1 className="text-center mt-5">Welcome to the Library Management System</h1>
      </div>
    );
  }
}
export default Home;
